import React from 'react';

export const MockMail = ({ loggedIn, currentLoggedInUser }) => {
    console.log("loggedIn:", loggedIn);
    console.log("currentLoggedInUser:", currentLoggedInUser);
    return (
        <>
            {loggedIn && <h1>Welcome, {currentLoggedInUser}!</h1>}
        </>
    )
}
